function History(props) {
   function viewResults(result){
        props.historyfunc(result);
    }
    console.log(props.history[0].result);
    return (
        <div>
            <ul>
               {props.history.map((item,index)=>{
                   return(<li key={index} onClick={()=>{viewResults(item.result,item.method,item,url)}}>{item.method} {item.url}</li>)
               })} 
            </ul>
        </div>
    )
}
export default History
